import Login from "../components/Login";
import RegisterUser from "../components/RegisterUser";


function RoutesApp() {
    return (
        <Route>
            <Route path="/" element={<Login></Login>}></Route>
            <Route path="/createAccount" element={<RegisterUser></RegisterUser>}></Route>
        </Route>
    )
}
